import './App.css';
import Accordion from 'react-bootstrap/Accordion';

function BasicExample() {
  return (
    <>
      <h1>{user.name}</h1>
      <img
        className="avatar"
        src={user.imageUrl}
        alt={'Photo of ' + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}
      />
    </>
  );
}



function App() {
  return (
    <div>
      <h1>Welcome to my app</h1>
      <BasicExample />
    </div>
  );
}

export default App;
